import React from "react";
import {Header,WhyYoga,Hero,Classes,Stories,Gallery,Footer} from "./gym"
const About = () => {
  return <div>


    <Header />
    <WhyYoga />
    <Hero />
    <Classes />
    <Stories />
    <Gallery/>
    <Footer/>
  </div>;
};

export default About;
